    def country_name(self, country_id):
        return list(self.country_names.keys())[list(self.country_names.values()).index(country_id)]

    def ids_by_country(self, country='ALL', only_trade=False):
        result = []
        if country != 'ALL':
            for i in self.data[self.country_names[country]].keys():
                if isinstance(i, str):
                    result += self.ids_by_company(country, i, only_trade)
                else:
                    if not only_trade or self.data[self.country_names[country]][i]['trade'] > 0:
                        result.append(i)
        else:
            for i in self.data:
                result += self.ids_by_country(self.country_name(i), only_trade)
        return result

    def ids_by_company(self, country, company, only_trade=False):
        result = []
        for i in self.data[self.country_names[country]][company].keys():
            if isinstance(i, str):
                result += self.ids_by_brewery(country, company, i, only_trade)
            else:
                if not only_trade or self.data[self.country_names[country]][company][i]['trade'] > 0:
                    result.append(i)
        return result

    def ids_by_brewery(self, country, company, brewery, only_trade=False):
        result = []
        for i in self.data[self.country_names[country]][company][brewery].keys():
            if not only_trade or self.data[self.country_names[country]][company][brewery][i]['trade'] > 0:
                result.append(i)
        return result

    def companies_by_country(self, country):
        result = []
        for i in self.data[self.country_names[country]].keys():
            if isinstance(i, str):
                result.append(i)
        return result

    def breweries_by_company(self, country, company):
        result = []
        for i in self.data[self.country_names[country]][company].keys():
            if isinstance(i, str):
                result.append(i)
        return result

    def details_by_id(self, cap_id):
        for country in self.country_names:
            if cap_id in self.ids_by_country(country):
                if cap_id in self.data[self.country_names[country]]:
                    test = {'country': country}
                    test.update(self.data[self.country_names[country]][cap_id])
                    return test
                else:
                    for company in self.data[self.country_names[country]]:
                        if cap_id in self.ids_by_company(country, company):
                            if cap_id in self.data[self.country_names[country]][company]:
                                test = {'country': country, 'company': company}
                                test.update(
                                    self.data[self.country_names[country]][company][cap_id])
                                return test
                            else:
                                for brewery in self.data[self.country_names[country]][company]:
                                    if cap_id in self.ids_by_brewery(country, company, brewery):
                                        test = {
                                            'country': country, 'company': company, 'brewery': brewery}
                                        test.update(
                                            self.data[self.country_names[country]][company][brewery][cap_id])
                                        return test

    def count_caps(self, country='ALL', company='ALL', brewery='ALL', only_trade=False):
        if brewery != 'ALL':
            return len(self.ids_by_brewery(country, company, brewery, only_trade))
        if company != 'ALL':
            return len(self.ids_by_company(country, company, only_trade))
        return len(self.ids_by_country(country, only_trade))


